---
description: Concourse CI/CD Web Interface and Database
icon_image: 
label: Concourse Web/DB
metadata_version: '1.8'
minimum_version_for_upgrade: 0.0.1
name: concourse_web
product_version: 0.0.2
rank: 1
requires_product_versions: null
serial: true
service_broker: false
standalone: false


releases:
- file: concourse-7.11.2.tgz
  name: concourse
  version: '7.11.2'
- file: postgres-53.0.3.tgz
  name: postgres
  version: '53.0.3'
- file: uaa-77.30.0.tgz
  name: uaa
  version: '77.30.0'
- file: credhub-2.14.2.tgz
  name: credhub
  version: '2.14.2'

stemcell_criteria:
  os: ubuntu-jammy
  requires_cpi: false
  version: 1.*


property_blueprints:
- configurable: true
  default: concourse_web-org
  name: org
  type: string
- configurable: true
  default: concourse_web-space
  name: space
  type: string
- configurable: true
  default: false
  name: apply_open_security_group
  type: boolean
- configurable: true
  default: false
  name: allow_paid_service_plans
  type: boolean
- configurable: true
  default: https://concourse.example.com
  description: External URL for Concourse Web UI
  label: External URL
  name: external_url
  optional: false
  type: string
- configurable: true
  description: Public key for worker authentication (optional)
  label: Worker Public Key
  name: worker_key_pub
  optional: true
  type: text
- configurable: true
  default: admin
  description: Username for basic authentication
  label: Basic Auth Username
  name: basic_auth_username
  optional: false
  type: string


form_types: 
- description: Configure Concourse Web/DB settings
  label: Web Configuration
  name: web_config
  property_inputs:
  - description: External URL for Concourse Web UI
    label: External URL
    reference: .properties.external_url
  - description: Public key for worker authentication (optional)
    label: Worker Public Key
    reference: .properties.worker_key_pub
  - description: Username for basic authentication
    label: Basic Auth Username
    reference: .properties.basic_auth_username


job_types: 
- dynamic_ip: 0
  instance_definition:
    configurable: true
    default: 1
    name: instances
    type: integer
  manifest: |
    allow_paid_service_plans: (( .properties.allow_paid_service_plans.value ))
    app_domains:
    - (( ..cf.cloud_controller.apps_domain.value ))
    apply_open_security_group: (( .properties.apply_open_security_group.value ))
    basic_auth_username: (( .properties.basic_auth_username.value ))
    cf:
      admin_password: (( ..cf.uaa.system_services_credentials.password ))
      admin_user: (( ..cf.uaa.system_services_credentials.identity ))
    concourse_web:
      name: concourse_web
    credhub:
      name: credhub
    domain: (( ..cf.cloud_controller.system_domain.value ))
    external_url: (( .properties.external_url.value ))
    opsman_ca: (( $ops_manager.ca_certificate ))
    org: (( .properties.org.value ))
    postgres:
      name: postgres
    space: (( .properties.space.value ))
    ssl:
      skip_cert_verify: (( ..cf.ha_proxy.skip_cert_verify.value ))
    uaa:
      admin_client: (( ..cf.uaa.admin_client_credentials.identity ))
      admin_client_secret: (( ..cf.uaa.admin_client_credentials.password ))
      name: uaa
    worker_key_pub: (( .properties.worker_key_pub.value ))
  max_in_flight: 1
  name: web
  property_blueprints:
  - default:
      identity: vcap
    name: vm_credentials
    type: salted_credentials
  resource_definitions:
  - configurable: true
    constraints:
      min: 4096
    default: 4096
    name: ram
    type: integer
  - configurable: true
    constraints:
      min: 16384
    default: 16384
    name: ephemeral_disk
    type: integer
  - configurable: true
    constraints:
      min: 32768
    default: 32768
    name: persistent_disk
    type: integer
  - configurable: true
    constraints:
      min: 2
    default: 2
    name: cpu
    type: integer
  resource_label: web
  single_az_only: false
  static_ip: 1
  templates:
  - name: web
    release: concourse
- dynamic_ip: 0
  instance_definition:
    configurable: true
    default: 1
    name: instances
    type: integer
  manifest: |
    allow_paid_service_plans: (( .properties.allow_paid_service_plans.value ))
    app_domains:
    - (( ..cf.cloud_controller.apps_domain.value ))
    apply_open_security_group: (( .properties.apply_open_security_group.value ))
    basic_auth_username: (( .properties.basic_auth_username.value ))
    cf:
      admin_password: (( ..cf.uaa.system_services_credentials.password ))
      admin_user: (( ..cf.uaa.system_services_credentials.identity ))
    concourse_web:
      name: concourse_web
    credhub:
      name: credhub
    databases:
    - name: concourse
      password: (( .properties.db_password.value ))
      user: concourse
    domain: (( ..cf.cloud_controller.system_domain.value ))
    external_url: (( .properties.external_url.value ))
    opsman_ca: (( $ops_manager.ca_certificate ))
    org: (( .properties.org.value ))
    postgres:
      name: postgres
    space: (( .properties.space.value ))
    ssl:
      skip_cert_verify: (( ..cf.ha_proxy.skip_cert_verify.value ))
    uaa:
      admin_client: (( ..cf.uaa.admin_client_credentials.identity ))
      admin_client_secret: (( ..cf.uaa.admin_client_credentials.password ))
      name: uaa
    worker_key_pub: (( .properties.worker_key_pub.value ))
  max_in_flight: 1
  name: postgres
  property_blueprints:
  - default:
      identity: vcap
    name: vm_credentials
    type: salted_credentials
  resource_definitions:
  - configurable: true
    constraints:
      min: 2048
    default: 2048
    name: ram
    type: integer
  - configurable: true
    constraints:
      min: 8192
    default: 8192
    name: ephemeral_disk
    type: integer
  - configurable: true
    constraints:
      min: 16384
    default: 16384
    name: persistent_disk
    type: integer
  - configurable: true
    constraints:
      min: 1
    default: 1
    name: cpu
    type: integer
  resource_label: postgres
  single_az_only: false
  static_ip: 1
  templates:
  - name: postgres
    release: postgres
- dynamic_ip: 0
  instance_definition:
    configurable: true
    default: 1
    name: instances
    type: integer
  manifest: |
    allow_paid_service_plans: (( .properties.allow_paid_service_plans.value ))
    app_domains:
    - (( ..cf.cloud_controller.apps_domain.value ))
    apply_open_security_group: (( .properties.apply_open_security_group.value ))
