    external_url: (( .properties.external_url.value ))
    opsman_ca: (( $ops_manager.ca_certificate ))
    org: (( .properties.org.value ))
    postgres:
      name: postgres
    space: (( .properties.space.value ))
    ssl:
      skip_cert_verify: (( ..cf.ha_proxy.skip_cert_verify.value ))
    uaa:
      admin_client: (( ..cf.uaa.admin_client_credentials.identity ))
      admin_client_secret: (( ..cf.uaa.admin_client_credentials.password ))
      name: uaa
    worker_key_pub: (( .properties.worker_key_pub.value ))
  max_in_flight: 1
  name: uaa
  property_blueprints:
  - default:
      identity: vcap
    name: vm_credentials
    type: salted_credentials
  resource_definitions:
  - configurable: true
    constraints:
      min: 2048
    default: 2048
    name: ram
    type: integer
  - configurable: true
    constraints:
      min: 8192
    default: 8192
    name: ephemeral_disk
    type: integer
  - configurable: true
    constraints:
      min: 0
    default: 0
    name: persistent_disk
    type: integer
  - configurable: true
    constraints:
      min: 1
    default: 1
    name: cpu
    type: integer
  resource_label: uaa
  single_az_only: false
  static_ip: 1
  templates:
  - name: uaa
    release: uaa
